        return (
            <div className="Container-fluid">
                <div className="row askquestion">
                    <div className="col-1"> <img className="home-img" src={user} width="20px" height="20px" /> </div>
                    <div className="col-11 uname"> <b>User Name</b> </div>
                </div>
            </div>
        )
    }
}
